(0, '朝に就ての童話的構図', '<ruby><rb>苔</rb><rp>（</rp><rt>こけ</rt><rp>）</rp></ruby>いちめんに、霧がぽしやぽしや降つて、<ruby><rb>蟻</rb><rp>（</rp><rt>あり</rt><rp>）</rp></ruby>の<ruby><rb>歩哨</rb><rp>（</rp><rt>ほせう</rt><rp>）</rp></ruby>は、鉄の帽子のひさしの下から、するどいひとみであたりをにらみ、青く大きな<ruby><rb>羊歯</rb><rp>（</rp><rt>しだ</rt><rp>）</rp></ruby>の森の前をあちこち行つたり来たりしてゐます。<br />\r\n　向ふからぷるぷるぷるぷる一ぴきの蟻の兵隊が走つて来ます。<br />\r\n「<ruby><rb>停</rb><rp>（</rp><rt>と</rt><rp>）</rp></ruby>まれ、<ruby><rb>誰</rb><rp>（</rp><rt>たれ</rt><rp>）</rp></ruby>かツ」<br />\r\n「第百二十八<ruby><rb>聯隊</rb><rp>（</rp><rt>れんたい</rt><rp>）</rp></ruby>の伝令！」<br />\r\n「どこへ行くか」<br />\r\n「第五十聯隊　聯隊本部」<br />\r\n　歩哨はスナイドル式の銃剣を、向ふの胸に斜めにつきつけたまま、その眼の光りやうや<ruby><rb>顎</rb><rp>（</rp><rt>あご</rt><rp>）</rp></ruby>のかたち、それから上着の<ruby><rb>袖</rb><rp>（</rp><rt>そで</rt><rp>）</rp></ruby>の模様や靴の<ruby><rb>工合</rb><rp>（</rp><rt>ぐあひ</rt><rp>）</rp></ruby>、いちいち詳しく調べます。<br />\r\n「よし、通れ」<br />\r\n　伝令はいそがしく羊歯の森のなかへ入つて行きました。<br />\r\n　霧の粒はだんだん小さく小さくなつて、いまはもううすい乳いろのけむりに変り、草や木の水を吸ひあげる音は、あつちにもこつちにも忙しく聞え出しました。さすがの歩哨もたうとう<ruby><rb>睡</rb><rp>（</rp><rt>ねむ</rt><rp>）</rp></ruby>さにふらつとします。<br />\r\n　二<ruby><rb>疋</rb><rp>（</rp><rt>ひき</rt><rp>）</rp></ruby>の蟻の子供らが、手をひいて、何かひどく笑ひながらやつて来ました。そして<ruby><rb>俄</rb><rp>（</rp><rt>には</rt><rp>）</rp></ruby>かに向ふの<ruby><rb>楢</rb><rp>（</rp><rt>なら</rt><rp>）</rp></ruby>の木の下を見てびつくりして立ちどまります。<br />\r\n「あつあれなんだらう。あんなとこにまつ白な家ができた」<br />\r\n「家ぢやない山だ」<br />\r\n「昨日はなかつたぞ」<br />\r\n「兵隊さんにきいて見よう」<br />\r\n「よし」<br />\r\n　二疋の蟻は走ります。<br />\r\n「兵隊さん、あすこにあるのなに？」<br />\r\n「何だうるさい、帰れ」<br />\r\n「兵隊さん、ゐねむりしてんだい。あすこにあるのなに？」<br />\r\n「うるさいなあ、どれだい、おや！」<br />\r\n「昨日はあんなものなかつたよ」<br />\r\n「おい、大変だ。おい。おまへたちはこどもだけれども、かういふときには立派にみんなのお役に立つだらうなあ。いゝか。おまへはね、この森を入つて行つてアルキル中佐どのにお目にかゝる。それからおまへはうんと走つて陸地測量部まで行くんだ。そして二人ともかう云ふんだ。北緯二十五度東経六厘の<ruby><rb>処</rb><rp>（</rp><rt>ところ</rt><rp>）</rp></ruby>に、目的のわからない大きな工事ができましたとな。二人とも云つてごらん」<br />\r\n「北緯二十五度東経六厘の処に目的のわからない大きな工事ができました」<br />\r\n「さうだ。では早く。そのうち私は決してこゝを離れないから」<br />\r\n　<ruby><rb>蟻</rb><rp>（</rp><rt>あり</rt><rp>）</rp></ruby>の子供らは一目散にかけて行きます。<br />\r\n　<ruby><rb>歩哨</rb><rp>（</rp><rt>ほせう</rt><rp>）</rp></ruby>は剣をかまへて、じつとそのまつしろな太い柱の、大きな屋根のある工事をにらみつけてゐます。<br />\r\n　それはだんだん大きくなるやうです。だいいち<ruby><rb>輪廓</rb><rp>（</rp><rt>りんくわく</rt><rp>）</rp></ruby>のぼんやり白く光つてぷるぷるぷるぷる<ruby><rb>顫</rb><rp>（</rp><rt>ふる</rt><rp>）</rp></ruby>へてゐることでもわかります。<br />\r\n　<ruby><rb>俄</rb><rp>（</rp><rt>には</rt><rp>）</rp></ruby>かにぱつと暗くなり、そこらの<ruby><rb>苔</rb><rp>（</rp><rt>こけ</rt><rp>）</rp></ruby>はぐらぐらゆれ、蟻の歩哨は夢中で頭をかかへました。眼をひらいてまた見ますと、あのまつ白な建物は、柱が折れてすつかり引つくり返つてゐます。<br />\r\n　蟻の子供らが両方から帰つてきました。<br />\r\n「兵隊さん。構はないさうだよ。あれはきのこといふものだつて。何でもないつて。アルキル中佐はうんと笑つたよ。それからぼくをほめたよ」<br />\r\n「あのね、すぐなくなるつて。地図に入れなくてもいいつて。あんなもの地図に入れたり消したりしてゐたら、陸地測量部など百あつても足りないつて。おや！　引つくりかへつてらあ」<br />\r\n「たつたいま倒れたんだ」歩哨は少しきまり悪さうに云ひました。<br />\r\n「なあんだ。あつ。あんなやつも出て来たぞ」<br />\r\n　向ふに魚の骨の形をした灰いろのをかしなきのこが、とぼけたやうに光りながら、枝がついたり手が出たりだんだん地面からのびあがつてきます。二疋の蟻の子供らは、それを指さして、笑つて笑つて笑ひます。<br />\r\n　そのとき霧の向ふから、大きな赤い日がのぼり、<ruby><rb>羊歯</rb><rp>（</rp><rt>しだ</rt><rp>）</rp></ruby>もすぎごけもにはかにぱつと青くなり、蟻の歩哨は、また<ruby><rb>厳</rb><rp>（</rp><rt>いか</rt><rp>）</rp></ruby>めしくスナイドル式銃剣を南の方へ構へました。<br />\r\n', '<ruby><rb>苔</rb><rp>（</rp><rt>こけ</rt><rp>）</rp></ruby>いちめんに、霧がぽしやぽしや降つて、<ruby><rb>蟻</rb><rp>（</rp><rt>あり</rt><rp>）</rp></ruby>の<ruby><rb>歩哨</rb><rp>（</rp><rt>ほせう</rt><rp>）</rp></ruby>は、鉄の帽子のひさしの下から、するどいひとみであたりをにらみ、青く大きな<ruby><rb>羊歯</rb><rp>（</rp><rt>しだ</rt><rp>）</rp></ruby>の森の前をあちこち行つたり来たりしてゐます。<br />\r\n', '2015-09-22', '2015-09-22', '2015-09-21', 0, '宮沢賢治', 0, , '朝', 0, 0);
