(1, 'うろこ雲', 'そらいちめんに青白いうろこ雲が浮かび月はその一切れに入って鈍い虹を掲げる。<br>\r\n　町の曲り角の屋敷にある木は脊高の梨の木で高くその柔らかな葉を動かしてゐるのだ。<br>\r\n　雲のきれ間にせはしく青くまたたくやつはそれも何だかわからない。<br>\r\n　今夜はほんたうにどうしたかな。八時頃からどこでもみんな戸を閉めて通りを一人も歩かない。<br>\r\n　お城の下の麥を干したらしい空くひの列に沿って小さな犬が馳けて來る。重く流れる月光の底をその小さな犬が尾をふって來る。<br>\r\n　夜の赤砂利、陰影だけで出來あがった赤砂利の層。櫻の梢は立派な寄木を遠い南の空に組み上げ私はたばこよりも寂しく煙る地平線にかすかな泪をながす。<br>\r\n　町はまことに諒闇の龍宮城また東京の王子の夜であります。<br>\r\n　北上岸の製板所の立て並べられた板の前を小さな男の子がふいと歩く。<br>\r\n　それから鐵橋の石で疊んだ橋臺が白くほのびかりしてならび私の心はどこかずうっと遠くの方を慕ってゐる。<br>\r\n　もう爪草の花が咲いた。さうだ。一面の爪草の花、青白いともしびを點じ微かな悦びをくゆらしそれから月光を吸ふつめくさの原。<br>\r\n　小さな甲蟲がまっすぐに飛んで來て私の額に突き當りヒョロヒョロ危く墮ちようとして途方もない方へ飛び戻る。<br>\r\n　原のむかふに小さな男が立ってゐる。銀の小人が立ってゐる。よこめでこっちを見ながら立ってゐる。にやにやわらってゐる。にやにや笑ってうたってゐる。銀の小人。<br>\r\n「なんばん鐵のかぶとむし<br>\r\n　月のあかりも　つめくさの<br>\r\n　ともすあかりも　眼に入らず<br>\r\n　草のにほひをとび截って<br>\r\n　ひとのひたひに突きあたり<br>\r\n　あわててよろよろ<br>\r\n　落ちるをやっとふみとまり<br>\r\n　いそんでかぢを立てなほし<br>\r\n　月のあかりも　つめくさの<br>\r\n　ともすあかりも眼に入らず<br>\r\n　途方もない方に　飛んで行く。」<br>\r\n　原のむかふに銀の小人が消えて行く。よこめでこっちを見ながら腕を組んだまま消えて行く。<br>\r\n　アカシヤの梢に綿雲が一杯にかかる。<br>\r\n　そのはらわたの鈍い月光の虹、それから小學校の窓ガラスがさびしく光り、ひるま算術に立たされた子供の小さな執念が、可愛い黒い幽靈になってじっと窓から外を眺めてゐる。<br>\r\n　空がはれて、そのみがかれた天河石の板の上を貴族風の月と紅い火星とが少しの軋りの聲もなく滑って行く。めぐって行く。<br>', 'そらいちめんに青白いうろこ雲が浮かび月はその一切れに入って鈍い虹を掲げる。<br>\r\n　町の曲り角の屋敷にある木は脊高の梨の木で高くその柔らかな葉を動かしてゐるのだ。<br>\r\n　雲のきれ間にせはしく青くまたたくやつはそれも何だかわからない。<br>\r\n', '2015-09-22', '2015-09-22', '2015-09-22', 0, '宮沢賢治', 0, 0x30, '', 0, 0);
