(2, 'ありときのこ', '<ruby><rb>苔</rb><rp>（</rp><rt>こけ</rt><rp>）</rp></ruby>いちめんに、<ruby><rb>霧</rb><rp>（</rp><rt>きり</rt><rp>）</rp></ruby>がぽしゃぽしゃ<ruby><rb>降</rb><rp>（</rp><rt>ふ</rt><rp>）</rp></ruby>って、<ruby><rb>蟻</rb><rp>（</rp><rt>あり</rt><rp>）</rp></ruby>の<ruby><rb>歩哨</rb><rp>（</rp><rt>ほしょう</rt><rp>）</rp></ruby>は<ruby><rb>鉄</rb><rp>（</rp><rt>てつ</rt><rp>）</rp></ruby>の<ruby><rb>帽子</rb><rp>（</rp><rt>ぼうし</rt><rp>）</rp></ruby>のひさしの下から、するどいひとみであたりをにらみ、青く大きな<ruby><rb>羊歯</rb><rp>（</rp><rt>しだ</rt><rp>）</rp></ruby>の森の前をあちこち行ったり来たりしています。<br />\r\n　<ruby><rb>向</rb><rp>（</rp><rt>む</rt><rp>）</rp></ruby>こうからぷるぷるぷるぷる一ぴきの<ruby><rb>蟻</rb><rp>（</rp><rt>あり</rt><rp>）</rp></ruby>の<ruby><rb>兵隊</rb><rp>（</rp><rt>へいたい</rt><rp>）</rp></ruby>が走って来ます。<br />\r\n「<ruby><rb>停</rb><rp>（</rp><rt>と</rt><rp>）</rp></ruby>まれ、<ruby><rb>誰</rb><rp>（</rp><rt>だれ</rt><rp>）</rp></ruby>かッ」<br />\r\n「<ruby><rb>第</rb><rp>（</rp><rt>だい</rt><rp>）</rp></ruby>百二十八<ruby><rb>聯隊</rb><rp>（</rp><rt>れんたい</rt><rp>）</rp></ruby>の<ruby><rb>伝令</rb><rp>（</rp><rt>でんれい</rt><rp>）</rp></ruby>！」<br />\r\n「どこへ行くか」<br />\r\n「第五十聯隊　聯隊<ruby><rb>本部</rb><rp>（</rp><rt>ほんぶ</rt><rp>）</rp></ruby>」<br />\r\n　歩哨はスナイドル<ruby><rb>式</rb><rp>（</rp><rt>しき</rt><rp>）</rp></ruby>の<ruby><rb>銃剣</rb><rp>（</rp><rt>じゅうけん</rt><rp>）</rp></ruby>を、<ruby><rb>向</rb><rp>（</rp><rt>む</rt><rp>）</rp></ruby>こうの<ruby><rb>胸</rb><rp>（</rp><rt>むね</rt><rp>）</rp></ruby>に<ruby><rb>斜</rb><rp>（</rp><rt>なな</rt><rp>）</rp></ruby>めにつきつけたまま、その<ruby><rb>眼</rb><rp>（</rp><rt>め</rt><rp>）</rp></ruby>の光りようや<ruby><rb>顎</rb><rp>（</rp><rt>あご</rt><rp>）</rp></ruby>のかたち、それから<ruby><rb>上着</rb><rp>（</rp><rt>うわぎ</rt><rp>）</rp></ruby>の<ruby><rb>袖</rb><rp>（</rp><rt>そで</rt><rp>）</rp></ruby>の<ruby><rb>模様</rb><rp>（</rp><rt>もよう</rt><rp>）</rp></ruby>や<ruby><rb>靴</rb><rp>（</rp><rt>くつ</rt><rp>）</rp></ruby>のぐあい、いちいち<ruby><rb>詳</rb><rp>（</rp><rt>くわ</rt><rp>）</rp></ruby>しく<ruby><rb>調</rb><rp>（</rp><rt>しら</rt><rp>）</rp></ruby>べます。<br />\r\n「よし、通れ」<br />\r\n　伝令はいそがしく<ruby><rb>羊歯</rb><rp>（</rp><rt>しだ</rt><rp>）</rp></ruby>の森のなかへはいって行きました。<br />\r\n　<ruby><rb>霧</rb><rp>（</rp><rt>きり</rt><rp>）</rp></ruby>の<ruby><rb>粒</rb><rp>（</rp><rt>つぶ</rt><rp>）</rp></ruby>はだんだん小さく小さくなって、いまはもう、うすい<ruby><rb>乳</rb><rp>（</rp><rt>ちち</rt><rp>）</rp></ruby>いろのけむりに<ruby><rb>変</rb><rp>（</rp><rt>か</rt><rp>）</rp></ruby>わり、草や木の水を<ruby><rb>吸</rb><rp>（</rp><rt>す</rt><rp>）</rp></ruby>いあげる音は、あっちにもこっちにも<ruby><rb>忙</rb><rp>（</rp><rt>いそが</rt><rp>）</rp></ruby>しく聞こえだしました。さすがの歩哨もとうとうねむさにふらっとします。<br />\r\n　二<ruby><rb>疋</rb><rp>（</rp><rt>ひき</rt><rp>）</rp></ruby>の<ruby><rb>蟻</rb><rp>（</rp><rt>あり</rt><rp>）</rp></ruby>の<ruby><rb>子供</rb><rp>（</rp><rt>こども</rt><rp>）</rp></ruby>らが、手をひいて、何かひどく<ruby><rb>笑</rb><rp>（</rp><rt>わら</rt><rp>）</rp></ruby>いながらやって来ました。そしてにわかに<ruby><rb>向</rb><rp>（</rp><rt>む</rt><rp>）</rp></ruby>こうの<ruby><rb>楢</rb><rp>（</rp><rt>なら</rt><rp>）</rp></ruby>の木の下を見てびっくりして立ちどまります。<br />\r\n「あっ、あれなんだろう。あんなところにまっ白な家ができた」<br />\r\n「家じゃない山だ」<br />\r\n「昨日はなかったぞ」<br />\r\n「<ruby><rb>兵隊</rb><rp>（</rp><rt>へいたい</rt><rp>）</rp></ruby>さんにきいてみよう」<br />\r\n「よし」<br />\r\n　二疋の蟻は走ります。<br />\r\n「兵隊さん、あすこにあるのなに？」<br />\r\n「なんだうるさい、帰れ」<br />\r\n「兵隊さん、いねむりしてんだい。あすこにあるのなに？」<br />\r\n「うるさいなあ、どれだい、おや！」<br />\r\n「昨日はあんなものなかったよ」<br />\r\n「おい、<ruby><rb>大変</rb><rp>（</rp><rt>たいへん</rt><rp>）</rp></ruby>だ。おい。おまえたちはこどもだけれども、こういうときには<ruby><rb>立派</rb><rp>（</rp><rt>りっぱ</rt><rp>）</rp></ruby>にみんなのお<ruby><rb>役</rb><rp>（</rp><rt>やく</rt><rp>）</rp></ruby>にたつだろうなあ。いいか。おまえはね、この森をはいって行ってアルキル<ruby><rb>中佐</rb><rp>（</rp><rt>ちゅうさ</rt><rp>）</rp></ruby>どのにお目にかかる。それからおまえはうんと走って<ruby><rb>陸地測量部</rb><rp>（</rp><rt>りくちそくりょうぶ</rt><rp>）</rp></ruby>まで行くんだ。そして二人ともこう<ruby><rb>言</rb><rp>（</rp><rt>い</rt><rp>）</rp></ruby>うんだ。<ruby><rb>北緯</rb><rp>（</rp><rt>ほくい</rt><rp>）</rp></ruby>二十五<ruby><rb>度</rb><rp>（</rp><rt>ど</rt><rp>）</rp></ruby><ruby><rb>東経</rb><rp>（</rp><rt>とうけい</rt><rp>）</rp></ruby>六<ruby><rb>厘</rb><rp>（</rp><rt>りん</rt><rp>）</rp></ruby>の<ruby><rb>処</rb><rp>（</rp><rt>ところ</rt><rp>）</rp></ruby>に、<ruby><rb>目的</rb><rp>（</rp><rt>もくてき</rt><rp>）</rp></ruby>のわからない大きな<ruby><rb>工事</rb><rp>（</rp><rt>こうじ</rt><rp>）</rp></ruby>ができましたとな。二人とも言ってごらん」<br />\r\n「<ruby><rb>北緯</rb><rp>（</rp><rt>ほくい</rt><rp>）</rp></ruby>二十五<ruby><rb>度</rb><rp>（</rp><rt>ど</rt><rp>）</rp></ruby><ruby><rb>東経</rb><rp>（</rp><rt>とうけい</rt><rp>）</rp></ruby>六<ruby><rb>厘</rb><rp>（</rp><rt>りん</rt><rp>）</rp></ruby>の<ruby><rb>処</rb><rp>（</rp><rt>ところ</rt><rp>）</rp></ruby>に<ruby><rb>目的</rb><rp>（</rp><rt>もくてき</rt><rp>）</rp></ruby>のわからない大きな<ruby><rb>工事</rb><rp>（</rp><rt>こうじ</rt><rp>）</rp></ruby>ができました」<br />\r\n「そうだ。では早く。そのうち私は<ruby><rb>決</rb><rp>（</rp><rt>けっ</rt><rp>）</rp></ruby>してここを<ruby><rb>離</rb><rp>（</rp><rt>はな</rt><rp>）</rp></ruby>れないから」<br />\r\n　<ruby><rb>蟻</rb><rp>（</rp><rt>あり</rt><rp>）</rp></ruby>の<ruby><rb>子供</rb><rp>（</rp><rt>こども</rt><rp>）</rp></ruby>らはいちもくさんにかけて行きます。<br />\r\n　<ruby><rb>歩哨</rb><rp>（</rp><rt>ほしょう</rt><rp>）</rp></ruby>は剣をかまえて、じっとそのまっしろな太い<ruby><rb>柱</rb><rp>（</rp><rt>はしら</rt><rp>）</rp></ruby>の、大きな<ruby><rb>屋根</rb><rp>（</rp><rt>やね</rt><rp>）</rp></ruby>のある工事をにらみつけています。<br />\r\n　それはだんだん大きくなるようです。だいいち<ruby><rb>輪廓</rb><rp>（</rp><rt>りんかく</rt><rp>）</rp></ruby>のぼんやり白く光ってぶるぶるぶるぶるふるえていることでもわかります。<br />\r\n　にわかにぱっと<ruby><rb>暗</rb><rp>（</rp><rt>くら</rt><rp>）</rp></ruby>くなり、そこらの<ruby><rb>苔</rb><rp>（</rp><rt>こけ</rt><rp>）</rp></ruby>はぐらぐらゆれ、<ruby><rb>蟻</rb><rp>（</rp><rt>あり</rt><rp>）</rp></ruby>の<ruby><rb>歩哨</rb><rp>（</rp><rt>ほしょう</rt><rp>）</rp></ruby>は<ruby><rb>夢中</rb><rp>（</rp><rt>むちゅう</rt><rp>）</rp></ruby>で頭をかかえました。<ruby><rb>眼</rb><rp>（</rp><rt>め</rt><rp>）</rp></ruby>をひらいてまた見ますと、あのまっ白な<ruby><rb>建物</rb><rp>（</rp><rt>たてもの</rt><rp>）</rp></ruby>は、柱が<ruby><rb>折</rb><rp>（</rp><rt>お</rt><rp>）</rp></ruby>れてすっかり引っくり<ruby><rb>返</rb><rp>（</rp><rt>かえ</rt><rp>）</rp></ruby>っています。<br />\r\n　蟻の子供らが<ruby><rb>両方</rb><rp>（</rp><rt>りょうほう</rt><rp>）</rp></ruby>から帰ってきました。<br />\r\n「<ruby><rb>兵隊</rb><rp>（</rp><rt>へいたい</rt><rp>）</rp></ruby>さん。かまわないそうだよ。あれはきのこというものだって。なんでもないって。アルキル<ruby><rb>中佐</rb><rp>（</rp><rt>ちゅうさ</rt><rp>）</rp></ruby>はうんと<ruby><rb>笑</rb><rp>（</rp><rt>わら</rt><rp>）</rp></ruby>ったよ。それからぼくをほめたよ」<br />\r\n「あのね、すぐなくなるって。地図に入れなくてもいいって。あんなもの地図に入れたり<ruby><rb>消</rb><rp>（</rp><rt>け</rt><rp>）</rp></ruby>したりしていたら、<ruby><rb>陸地測量部</rb><rp>（</rp><rt>りくちそくりょうぶ</rt><rp>）</rp></ruby>など百あっても足りないって。おや！　引っくりかえってらあ」<br />\r\n「たったいま<ruby><rb>倒</rb><rp>（</rp><rt>たお</rt><rp>）</rp></ruby>れたんだ」歩哨は少しきまり<ruby><rb>悪</rb><rp>（</rp><rt>わる</rt><rp>）</rp></ruby>そうに<ruby><rb>言</rb><rp>（</rp><rt>い</rt><rp>）</rp></ruby>いました。<br />\r\n「なあんだ。あっ。あんなやつも出て来たぞ」<br />\r\n　<ruby><rb>向</rb><rp>（</rp><rt>む</rt><rp>）</rp></ruby>こうに魚の<ruby><rb>骨</rb><rp>（</rp><rt>ほね</rt><rp>）</rp></ruby>の形をした<ruby><rb>灰</rb><rp>（</rp><rt>はい</rt><rp>）</rp></ruby>いろのおかしなきのこが、とぼけたように光りながら、<ruby><rb>枝</rb><rp>（</rp><rt>えだ</rt><rp>）</rp></ruby>がついたり手が出たりだんだん<ruby><rb>地面</rb><rp>（</rp><rt>じめん</rt><rp>）</rp></ruby>からのびあがってきます。二<ruby><rb>疋</rb><rp>（</rp><rt>ひき</rt><rp>）</rp></ruby>の<ruby><rb>蟻</rb><rp>（</rp><rt>あり</rt><rp>）</rp></ruby>の子供らは、それを<ruby><rb>指</rb><rp>（</rp><rt>ゆび</rt><rp>）</rp></ruby>さして、<ruby><rb>笑</rb><rp>（</rp><rt>わら</rt><rp>）</rp></ruby>って笑って笑います。<br />\r\n　そのとき<ruby><rb>霧</rb><rp>（</rp><rt>きり</rt><rp>）</rp></ruby>の<ruby><rb>向</rb><rp>（</rp><rt>む</rt><rp>）</rp></ruby>こうから、大きな赤い日がのぼり、<ruby><rb>羊歯</rb><rp>（</rp><rt>しだ</rt><rp>）</rp></ruby>もすぎごけもにわかにぱっと青くなり、蟻の<ruby><rb>歩哨</rb><rp>（</rp><rt>ほしょう</rt><rp>）</rp></ruby>は、またいかめしくスナイドル<ruby><rb>式銃剣</rb><rp>（</rp><rt>しきじゅうけん</rt><rp>）</rp></ruby>を南の方へ<ruby><rb>構</rb><rp>（</rp><rt>かま</rt><rp>）</rp></ruby>えました。<br />', '<ruby><rb>苔</rb><rp>（</rp><rt>こけ</rt><rp>）</rp></ruby>いちめんに、<ruby><rb>霧</rb><rp>（</rp><rt>きり</rt><rp>）</rp></ruby>がぽしゃぽしゃ<ruby><rb>降</rb><rp>（</rp><rt>ふ</rt><rp>）</rp></ruby>って、<ruby><rb>蟻</rb><rp>（</rp><rt>あり</rt><rp>）</rp></ruby>の<ruby><rb>歩哨</rb><rp>（</rp><rt>ほしょう</rt><rp>）</rp></ruby>は<ruby><rb>鉄</rb><rp>（</rp><rt>てつ</rt><rp>）</rp></ruby>の<ruby><rb>帽子</rb><rp>（</rp><rt>ぼうし</rt><rp>）</rp></ruby>のひさしの下から、するどいひとみであたりをにらみ、青く大きな<ruby><rb>羊歯</rb><rp>（</rp><rt>しだ</rt><rp>）</rp></ruby>の森の前をあちこち行ったり来たりしています。<br />', '2015-09-23', '2015-09-23', '2015-09-23', 0, '宮沢賢治', 0, , '', 0, 0);
INSERT INTO `article` (`article_id`, `title`, `text`, `overview`, `create_date`, `update_date`, `delivery_date`, `delivery_period_id`, `author`, `category_id`, `img`, `keyword`, `display_flag`, `archive_flag`) VALUES
(3, '星めぐりの歌', 'あかいめだまの　さそり<br />\r\nひろげた鷲の　　つばさ<br />\r\nあをいめだまの　小いぬ、<br />\r\nひかりのへびの　とぐろ。<br />\r\n<br />\r\nオリオンは高く　うたひ<br />\r\nつゆとしもとを　おとす、<br />\r\nアンドロメダの　くもは<br />\r\nさかなのくちの　かたち。<br />\r\n<br />\r\n大ぐまのあしを　きたに<br />\r\n五つのばした　　ところ。<br />\r\n小熊のひたいの　うへは<br />\r\nそらのめぐりの　めあて。<br />', 'あかいめだまの　さそり<br />\r\nひろげた鷲の　　つばさ<br />\r\nあをいめだまの　小いぬ、<br />\r\nひかりのへびの　とぐろ。<br />', '2015-09-23', '2015-09-23', '2015-09-24', 0, '宮沢賢治', 0, '', '', 0, 0),
(4, 'いてふの実', 'そらのてっぺんなんか冷たくて冷たくてまるでカチカチの<ruby><rb>灼</rb><rp>（</rp><rt>や</rt><rp>）</rp></ruby>きをかけた<ruby><rb>鋼</rb><rp>（</rp><rt>はがね</rt><rp>）</rp></ruby>です。<br />\r\n　そして星が一杯です。けれども東の空はもう優しい<ruby><rb>桔梗</rb><rp>（</rp><rt>ききゃう</rt><rp>）</rp></ruby>の花びらのやうにあやしい底光りをはじめました。<br />\r\n　その明け方の空の下、ひるの鳥でも<ruby><rb>行</rb><rp>（</rp><rt>ゆ</rt><rp>）</rp></ruby>かない高い所を鋭い霜のかけらが風に流されてサラサラサラサラ南の方へ飛んで<ruby><rb>行</rb><rp>（</rp><rt>ゆ</rt><rp>）</rp></ruby>きました。<br />\r\n　実にその<ruby><rb>微</rb><rp>（</rp><rt>かす</rt><rp>）</rp></ruby>かな音が丘の上の一本いてふの木に聞える位澄み切った明け方です。<br />\r\n　いてふの実はみんな一度に目をさましました。そしてドキッとしたのです。今日こそはたしかに旅立ちの日でした。みんなも前からさう思ってゐましたし、昨日の夕方やって来た二羽の<ruby><rb>烏</rb><rp>（</rp><rt>からす</rt><rp>）</rp></ruby>もさう<ruby><rb>云</rb><rp>（</rp><rt>い</rt><rp>）</rp></ruby>ひました。<br />\r\n「<ruby><rb>僕</rb><rp>（</rp><rt>ぼく</rt><rp>）</rp></ruby>なんか落ちる途中で<ruby><rb>眼</rb><rp>（</rp><rt>め</rt><rp>）</rp></ruby>がまはらないだらうか。」一つの実が云ひました。<br />\r\n「よく目をつぶって行けばいゝさ。」も一つが答へました。<br />\r\n「さうだ。忘れてゐた。僕水筒に水をつめて置くんだった。」<br />\r\n「僕はね、水筒の外に<ruby><rb>薄荷水</rb><rp>（</rp><rt>はくかすゐ</rt><rp>）</rp></ruby>を用意したよ。少しやらうか。旅へ出てあんまり心持ちの悪い時は<ruby><rb>一寸</rb><rp>（</rp><rt>ちょっと</rt><rp>）</rp></ruby>飲むといゝっておっかさんが云ったぜ。」<br />\r\n「なぜおっかさんは僕へは<ruby><rb>呉</rb><rp>（</rp><rt>く</rt><rp>）</rp></ruby>れないんだらう。」<br />\r\n「だから、僕あげるよ。お<ruby><rb>母</rb><rp>（</rp><rt>っか</rt><rp>）</rp></ruby>さんを悪く思っちゃすまないよ。」<br />\r\n　さうです。この<ruby><rb>銀杏</rb><rp>（</rp><rt>いてふ</rt><rp>）</rp></ruby>の木はお<ruby><rb>母</rb><rp>（</rp><rt>かあ</rt><rp>）</rp></ruby>さんでした。<br />\r\n　今年は千人の<ruby><rb>黄金</rb><rp>（</rp><rt>きん</rt><rp>）</rp></ruby>色の子供が生れたのです。<br />\r\n　そして今日こそ子供らがみんな一緒に旅に<ruby><rb>発</rb><rp>（</rp><rt>た</rt><rp>）</rp></ruby>つのです。お母さんはそれをあんまり悲しんで<ruby><rb>扇形</rb><rp>（</rp><rt>あふぎがた</rt><rp>）</rp></ruby>の黄金の髪の毛を昨日までにみんな落してしまひました。<br />\r\n「ね、あたしどんな<ruby><rb>所</rb><rp>（</rp><rt>とこ</rt><rp>）</rp></ruby>へ行くのかしら。」一人のいてふの女の子が空を見あげて<ruby><rb>呟</rb><rp>（</rp><rt>つぶ</rt><rp>）</rp></ruby>やくやうに云ひました。<br />\r\n「あたしだってわからないわ、どこへも行きたくないわね。」も一人が云ひました。<br />\r\n「あたしどんなめにあってもいゝからお<ruby><rb>母</rb><rp>（</rp><rt>っか</rt><rp>）</rp></ruby>さんの<ruby><rb>所</rb><rp>（</rp><rt>とこ</rt><rp>）</rp></ruby>に居たいわ。」<br />\r\n「だっていけないんですって。風が毎日さう云ったわ。」<br />\r\n「いやだわね。」<br />\r\n「そしてあたしたちもみんなばらばらにわかれてしまふんでせう。」<br />\r\n「えゝ、さうよ。もうあたしなんにもいらないわ。」<br />\r\n「あたしもよ。今までいろいろわが<ruby><rb>儘</rb><rp>（</rp><rt>まま</rt><rp>）</rp></ruby>ばっかし云って許して下さいね。」<br />\r\n「あら、あたしこそ。あたしこそだわ。許して<ruby><rb>頂戴</rb><rp>（</rp><rt>ちゃうだい</rt><rp>）</rp></ruby>。」<br />\r\n　東の空の桔梗の花びらはもういつかしぼんだやうに力なくなり、朝の白光りがあらはれはじめました。星が一つづつ消えて<ruby><rb>行</rb><rp>（</rp><rt>ゆ</rt><rp>）</rp></ruby>きます。<br />\r\n　木の一番一番高い<ruby><rb>処</rb><rp>（</rp><rt>ところ</rt><rp>）</rp></ruby>に居た二人のいてふの男の子が云ひました。<br />\r\n「そら、もう明るくなったぞ。<ruby><rb>嬉</rb><rp>（</rp><rt>うれ</rt><rp>）</rp></ruby>しいなあ。僕はきっと<ruby><rb>黄金</rb><rp>（</rp><rt>きん</rt><rp>）</rp></ruby>色のお星さまになるんだよ。」<br />\r\n「僕もなるよ。きっとこゝから落ちればすぐ北風が空へ連れてって呉れるだらうね。」<br />\r\n「僕は北風ぢゃないと思ふんだよ。北風は親切ぢゃないんだよ。僕はきっと<ruby><rb>烏</rb><rp>（</rp><rt>からす</rt><rp>）</rp></ruby>さんだらうと思ふね。」<br />\r\n「さうだ。きっと烏さんだ。烏さんは偉いんだよ。こゝから遠くてまるで見えなくなるまで一息に飛んで<ruby><rb>行</rb><rp>（</rp><rt>ゆ</rt><rp>）</rp></ruby>くんだからね。頼んだら僕ら二人位きっと一遍に青ぞら<ruby><rb>迄</rb><rp>（</rp><rt>まで</rt><rp>）</rp></ruby>連れて行って呉れるぜ。」<br />\r\n「頼んで見ようか。早く来るといゝな。」<br />\r\n　その少し下でもう二人が云ひました。<br />\r\n「僕は一番はじめに<ruby><rb>杏</rb><rp>（</rp><rt>あんず</rt><rp>）</rp></ruby>の王様のお城をたづねるよ。そしてお姫様をさらって行ったばけ物を退治するんだ。そんなばけ物がきっとどこかにあるね。」<br />\r\n「うん。あるだらう。けれどもあぶないぢゃないか。ばけ物は大きいんだよ。僕たちなんか鼻でふっと吹き飛ばされちまふよ。」<br />\r\n「僕ね、いゝもの持ってるんだよ。だから大丈夫さ。見せようか。そら、ね。」<br />\r\n「これお<ruby><rb>母</rb><rp>（</rp><rt>っか</rt><rp>）</rp></ruby>さんの髪でこさへた網ぢゃないの。」<br />\r\n「さうだよ。お<ruby><rb>母</rb><rp>（</rp><rt>っか</rt><rp>）</rp></ruby>さんが下すったんだよ。何か恐ろしいことのあったときは<ruby><rb>此</rb><rp>（</rp><rt>こ</rt><rp>）</rp></ruby>の中にかくれるんだって。僕ね、この網をふところに入れてばけ物に行ってね。もしもし。今日は、僕を<ruby><rb>呑</rb><rp>（</rp><rt>の</rt><rp>）</rp></ruby>めますか呑めないでせう。とかう云ふんだよ。ばけ物は怒ってすぐ呑むだらう。僕はその時ばけ物の胃袋の中でこの網を出してね、すっかり<ruby><rb>被</rb><rp>（</rp><rt>かぶ</rt><rp>）</rp></ruby>っちまふんだ。それからおなか中をめっちゃめちゃにこはしちまふんだよ。そら、ばけ物はチブスになって死ぬだらう。そこで僕は出て来て杏のお姫様を連れてお城に帰るんだ。そしてお姫様を<ruby><rb>貰</rb><rp>（</rp><rt>もら</rt><rp>）</rp></ruby>ふんだよ。」<br />\r\n「本当にいゝね、そんならその時僕はお客様になって行ってもいゝだらう。」<br />\r\n「いゝともさ。僕、国を半分わけてあげるよ。それからお<ruby><rb>母</rb><rp>（</rp><rt>っか</rt><rp>）</rp></ruby>さんへは毎日お菓子やなんか沢山あげるんだ。」<br />\r\n　星がすっかり消えました。東のそらは白く燃えてゐるやうです。木が<ruby><rb>俄</rb><rp>（</rp><rt>には</rt><rp>）</rp></ruby>かにざわざわしました。もう出発に間もないのです。<br />\r\n「僕、<ruby><rb>靴</rb><rp>（</rp><rt>くつ</rt><rp>）</rp></ruby>が小さいや。面倒くさい。はだしで行かう。」<br />\r\n「そんなら僕のと替へよう。僕のは少し大きいんだよ。」<br />\r\n「替へよう。あ、丁度いゝぜ。ありがたう。」<br />\r\n「わたし困ってしまふわ、おっかさんに貰った新しい<ruby><rb>外套</rb><rp>（</rp><rt>ぐわいたう</rt><rp>）</rp></ruby>が見えないんですもの。」<br />\r\n「早くおさがしなさいよ。どの枝に置いたの。」<br />\r\n「忘れてしまったわ。」<br />\r\n「困ったわね。これから非常に寒いんでせう。どうしても見附けないといけなくってよ。」<br />\r\n「そら、ね。いゝぱんだらう。ほし<ruby><rb>葡萄</rb><rp>（</rp><rt>ふだう</rt><rp>）</rp></ruby>が<ruby><rb>一寸</rb><rp>（</rp><rt>ちょっと</rt><rp>）</rp></ruby>顔を出してるだらう。早くかばんへ入れ<ruby><rb>給</rb><rp>（</rp><rt>たま</rt><rp>）</rp></ruby>へ。もうお日さまがお出ましになるよ。」<br />\r\n「ありがたう。ぢゃ<ruby><rb>貰</rb><rp>（</rp><rt>もら</rt><rp>）</rp></ruby>ふよ。ありがたう。一緒に行かうね。」<br />\r\n「困ったわ、わたし、どうしてもないわ。ほんたうにわたしどうしませう。」<br />\r\n「わたしと二人で行きませうよ。わたしのを時々貸してあげるわ。凍えたら一緒に死にませうよ。」<br />\r\n　東の空が白く燃え、ユラリユラリと揺れはじめました。おっかさんの木はまるで死んだやうになってじっと立ってゐます。<br />\r\n　突然光の束が<ruby><rb>黄金</rb><rp>（</rp><rt>きん</rt><rp>）</rp></ruby>の矢のやうに一度に飛んで来ました。子供らはまるで飛びあがる位輝やきました。<br />\r\n　北から氷のやうに冷たい透きとほった風がゴーッと吹いて来ました。<br />\r\n「さよなら、おっかさん。」「さよなら、おっかさん。」子供らはみんな一度に雨のやうに枝から飛び下りました。<br />\r\n　北風が笑って、<br />\r\n「今年もこれでまづさよならさよならって云ふわけだ。」と云ひながらつめたいガラスのマントをひらめかして向ふへ行ってしまひました。<br />\r\n　お日様は燃える宝石のやうに東の空にかかり、あらんかぎりのかゞやきを悲しむ母親の木と旅に出た子供らとに投げておやりなさいました。<br />\r\n', 'そらのてっぺんなんか冷たくて冷たくてまるでカチカチの<ruby><rb>灼</rb><rp>（</rp><rt>や</rt><rp>）</rp></ruby>きをかけた<ruby><rb>鋼</rb><rp>（</rp><rt>はがね</rt><rp>）</rp></ruby>です。', '2015-09-23', '2015-09-23', '2015-09-25', 0, '宮沢賢治', 0, '', '', 0, 0),
(5, 'あけがた', '　おれはその時その青黒く淀んだ室の中の堅い灰色の自分の席にそわそわ立ったり座ったりしてゐた。<br />\r\n　二人の男がその室の中に居た。一人はたしかに獣医の有本でも一人はさまざまのやつらのもやもやした区分キメラであった。<br />\r\n　おれはどこかへ出て行かうと考へてゐるらしかった。飛ぶんだぞ霧の中をきいっとふっとんでやるんだなどと頭の奥で叫んでゐた。ところがその二人がしきりに着物のはなしをした。<br />\r\n　おれはひどくむしゃくしゃした。そして卓をガタガタゆすってゐた。<br />\r\n　いきなり霧積が入って来た。霧積は変に白くぴかぴかする金襴の羽織を着てゐた。そしてひどく嬉しさうに見えた。今朝は支那版画展覧会があって自分はその幹事になってゐるからそっちへ行くんだと云ってかなり大声で笑った。おれはそれがしゃくにさわった。第一霧積は今日はおれと北の方の野原へ出かける約束だったのだ、それを白っぽい金襴の羽織などを着込んでわけもわからない処へ行ってけらけら笑ったりしやうといふのはあんまり失敬だと　おれは考へた。<br />\r\nところが霧積はどう云ふわけか急におれの着物を笑ひ出した。有本も笑った。区分キメラもつめたくあざ笑った。なんだ着物のことなどか　きさまらは男だらう　それに本気で着もののことを云ふのか、などとおれはそっと考へて見たがどうも気持が悪かった。それから今度は有本が何かもにやもにや云っておれを慰めるやうにした。<br />\r\nおれにはどういふわけで自分に着物が斯う足りないのかどう考へても判らなくてひどく悲しかった。そこでおれは立ちあがって云〔っ〕た。<br />\r\n「あたりまへさ。おれなんぞまだ着物など三つも四つもためられる訳はないんだ。おれはこれで沢山だ。」有本や霧積は何か眩しく光る絵巻か角帯らしいものをひろげて引っぱってしゃべってゐた。おれはぷいと外へ出た。そしていきなり川ばたの白い四角な家に入った。知らない赤い女が髪もよく削らずに立ってゐた。そしていきなり<br />\r\n「お履物はこちらへまはしましたから。」と云っておれの革スリッパを変な裏口のやうな土間に投げ出した。おれは「ふん」と云ひながらそっちへ行った。それでも気分はよかった。<br />\r\n片っ方のスリッパが裏返しになってゐた。その女が手を延ばして直す風をした。おれはこんな赤いすれっからしが本統にそれを直すかどうかと考へながら黙ってそれを見てゐた。<br />\r\n　女は本統にスリッパを直した。おれは外へ出た。<br />\r\n　川が烈しく鳴ってゐる。一月十五日の村の踊りの太鼓が向岸から強くひゞいて来る。強い透明な太鼓の音だ。<br />\r\n　川はあんまり冷たく物凄かった。おれは少し上流にのぼって行った。そこの所で川はまるで白と水色とぼろぼろになって崩れ落ちてゐた。そして殊更空の光が白く冷たかった。<br />\r\n（おれは全体川をきらひだ。）おれはかなり高い声で云った。<br />\r\n　ひどい洪水の後らしかった。もう水は澄んでゐた。それでも非常な水勢なのだ。波と波とが激しく拍って青くぎらぎらした。<br />\r\n　支流が北から落ちてゐた。おれはだまってその岸について溯った。<br />\r\n　空がツンツンと光ってゐる。水はごうごうと鳴ってゐた。おれはかなしかった。それから口笛を吹いた。口笛は向ふの方に行ってだんだん広く大きくなってしまひには手もつけられないやうにひろがった。<br />\r\n　そして向ふに大きな島が見えた。それはいつかの洪水でできてからもう余程の年を経たらしく高さも百尺はあった。栗や雑木が一杯にしげってゐた。<br />\r\n　おれはそっちへ行かうと思った。<br />\r\n　そしていつかもう島の上に立ってゐた。どうして川を渡ったらう、私は考へながらさびしくふり返った。<br />\r\n　たしかにそれは水が切れて小さなぴちゃぴちゃの瀬になってゐたのだ。<br />\r\n　おれは青白く光る空を見た。洪水がいつまた黒い壁のやうになって襲って来るかわからないと考へた。小さな子供のいきなりながされる模様を想像した。それから西の山脈を見た。それは碧くなめらかに光ってゐた。あんな明るいところで今雨の降ってゐるわけはない、おれは考へた。<br />\r\n　そらにひろがる高い雑木の梢を見た、あすこまで昇ればまづ大低の洪水なら大丈夫だ、そのうちにきっと弟が助けに来る、けれどもどうして助けるのかなとおれは考へた。<br />\r\n　いつか島が又もとの岸とくっついてゐた。その手前はうららかな孔雀石の馬蹄形の淵になってゐた。おれは立ちどまった。そして又口笛を吹いた。そして雑木の幹に白いきのこを見た。まっしろなさるのこしかけを見た。<br />\r\n　それから志木、大高と彫られた白い二列の文字を見た。<br />\r\n　瘠せてオーバアコートを着てわらじを穿いた男が青光りのさるとりいばらの中にまっすぐに立ってゐた。<br />\r\n「私は志木です。こゝの測量に着手したのは私であります。」帽子をとっていやに堅苦しくその男が云った。志木、志木とはてな、どこかで聞いたぞとおれは思った。', '　おれはその時その青黒く淀んだ室の中の堅い灰色の自分の席にそわそわ立ったり座ったりしてゐた。<br />', '2015-09-23', '2015-09-23', '2015-09-26', 0, '宮沢賢治', 0, '', '', 0, 0),
(6, '十月の末', '<ruby><rb>嘉</rb><rp>（</rp><rt>か</rt><rp>）</rp></ruby>ッコは、小さなわらじをはいて、赤いげんこを二つ顔の前にそろえて、ふっふっと息をふきかけながら、土間から外へ飛び出しました。外はつめたくて明るくて、そしてしんとしています。<br />\r\n　嘉ッコのお母さんは、大きな<strong class="SESAME_DOT">けら</strong>を着て、<ruby><rb>縄</rb><rp>（</rp><rt>なわ</rt><rp>）</rp></ruby>を<ruby><rb>肩</rb><rp>（</rp><rt>かた</rt><rp>）</rp></ruby>にかけて、そのあとから出て来ました。<br />\r\n「<ruby><rb>母</rb><rp>（</rp><rt>があ</rt><rp>）</rp></ruby>、<ruby><rb>昨夜</rb><rp>（</rp><rt>ゆべな</rt><rp>）</rp></ruby>、土ぁ、<ruby><rb>凍</rb><rp>（</rp><rt>し</rt><rp>）</rp></ruby>みだじゃぃ。」嘉ッコはしめった黒い地面を、ばたばた<ruby><rb>踏</rb><rp>（</rp><rt>ふ</rt><rp>）</rp></ruby>みながら<ruby><rb>云</rb><rp>（</rp><rt>い</rt><rp>）</rp></ruby>いました。<br />\r\n「うん、<ruby><rb>霜</rb><rp>（</rp><rt>しも</rt><rp>）</rp></ruby>ぁ降ったのさ。今日は畑ぁ、土ぁぐじゃぐじゃづがべもや。」と嘉ッコのお母さんは、半分ひとりごとのように答えました。<br />\r\n　嘉ッコのおばあさんが、やっぱりけらを着て、すっかり<ruby><rb>支度</rb><rp>（</rp><rt>したく</rt><rp>）</rp></ruby>をして、家の中から出て来ました。<br />\r\n　そして<ruby><rb>一寸</rb><rp>（</rp><rt>ちょっと</rt><rp>）</rp></ruby>手をかざして、明るい空を見まわしながらつぶやきました。<br />\r\n「<ruby><rb>爺</rb><rp>（</rp><rt>じ</rt><rp>）</rp></ruby>※<span class="notes">［＃小書き平仮名ん、145-13］</span>ごぁ、今朝も<ruby><rb>戻</rb><rp>（</rp><rt>もど</rt><rp>）</rp></ruby>て来なぃがべが。<ruby><rb>家</rb><rp>（</rp><rt>え</rt><rp>）</rp></ruby>でぁこったに<ruby><rb>忙</rb><rp>（</rp><rt>いしょ</rt><rp>）</rp></ruby>がしでば。」<br />\r\n「爺※<span class="notes">［＃小書き平仮名ん、145-14］</span>ごぁ、今朝も戻て来なぃがべが。」嘉ッコがいきなり<ruby><rb>叫</rb><rp>（</rp><rt>さけ</rt><rp>）</rp></ruby>びました。<br />\r\n　おばあさんはわらいました。<br />\r\n「うん。<strong class="SESAME_DOT">けづ</strong>な<ruby><rb>爺</rb><rp>（</rp><rt>じ</rt><rp>）</rp></ruby>※<span class="notes">［＃小書き平仮名ん、146-1］</span>ごだもな。<ruby><rb>酔</rb><rp>（</rp><rt>よ</rt><rp>）</rp></ruby>たぐれでばがり居で、一向仕事<ruby><rb>助</rb><rp>（</rp><rt>す</rt><rp>）</rp></ruby>けるもさないで。今日も町で飲んでらべぁな。うな<ruby><rb>は</rb><rp>（</rp><rt>ハ</rt><rp>）</rp></ruby>爺※<span class="notes">［＃小書き平仮名ん、146-2］</span>ごに<ruby><rb>肖</rb><rp>（</rp><rt>に</rt><rp>）</rp></ruby>るやなぃじゃぃ。」<br />\r\n「ダゴダア、ダゴダア、ダゴダア。」嘉ッコはもう走って<ruby><rb>垣</rb><rp>（</rp><rt>かき</rt><rp>）</rp></ruby>の出口の<ruby><rb>柳</rb><rp>（</rp><rt>やなぎ</rt><rp>）</rp></ruby>の木を見ていました。<br />\r\n　それはツンツン、ツンツンと鳴いて、<ruby><rb>枝中</rb><rp>（</rp><rt>えだじゅう</rt><rp>）</rp></ruby>はねあるく小さなみそさざいで<ruby><rb>一杯</rb><rp>（</rp><rt>いっぱい</rt><rp>）</rp></ruby>でした。<br />\r\n　実に柳は、今はその細長い葉をすっかり落して、冷たい風にほんのすこしゆれ、そのてっぺんの青ぞらには、町のお祭りの晩の<ruby><rb>電気菓子</rb><rp>（</rp><rt>でんきがし</rt><rp>）</rp></ruby>のような白い雲が、静に<ruby><rb>翔</rb><rp>（</rp><rt>か</rt><rp>）</rp></ruby>けているのでした。<br />\r\n「ツツンツツン、チ、チ、ツン、ツン。」<br />\r\n　みそさざいどもは、とんだりはねたり、柳の木のなかで、じつにおもしろそうにやっています。柳の木のなかというわけは、葉の落ちてカラッとなった柳の木の外側には、すっかりガラスが張ってあるような気がするのです。それですから、嘉ッコはますます大よろこびです。<br />\r\n　けれどもとうとう、そのすきとおるガラス<ruby><rb>函</rb><rp>（</rp><rt>ばこ</rt><rp>）</rp></ruby>もこわれました。それはお母さんやおばあさんがこっちへ来ましたので、嘉ッコが「ダア。」といいながら、両手をあげたものですから、小さなみそさざいどもは、みんなまるでまん円になって、ぼろんと飛んでしまったのです。<br />\r\n　さてみそさざいも飛びましたし、嘉ッコは走って<ruby><rb>街道</rb><rp>（</rp><rt>かいどう</rt><rp>）</rp></ruby>に出ました。<br />\r\n　電信ばしらが、<br />\r\n「ゴーゴー、ガーガー、キイミイガアアヨオワア、ゴゴー、ゴゴー、ゴゴー。」とうなっています。<br />\r\n　嘉ッコは街道のまん中に小さな<ruby><rb>腕</rb><rp>（</rp><rt>うで</rt><rp>）</rp></ruby>を組んで立ちながら、<ruby><rb>松並木</rb><rp>（</rp><rt>まつなみき</rt><rp>）</rp></ruby>のあっちこっちをよくよく<ruby><rb>眺</rb><rp>（</rp><rt>なが</rt><rp>）</rp></ruby>めましたが、松の葉がパサパサ続くばかり、そのほかにはずうっとはずれのはずれの方に、白い牛のようなものが頭だか足だか一寸出しているだけです。嘉ッコは街道を横ぎって、山の畑の方へ走りました。お母さんたちもあとから来ます。けれども、この<ruby><rb>路</rb><rp>（</rp><rt>みち</rt><rp>）</rp></ruby>ならば、お母さんよりおばあさんより、嘉ッコの方がよく知っているのでした。路のまん中に一寸顔を出している円いあばたの石ころさえも、嘉ッコはちゃんと知っているのでした。<ruby><rb>厭</rb><rp>（</rp><rt>あ</rt><rp>）</rp></ruby>きる位知っているのでした。<br />\r\n　嘉ッコは林にはいりました。松の木や<ruby><rb>楢</rb><rp>（</rp><rt>なら</rt><rp>）</rp></ruby>の木が、つんつんと光のそらに立っています。<br />\r\n　林を通り<ruby><rb>抜</rb><rp>（</rp><rt>ぬ</rt><rp>）</rp></ruby>けると、そこが嘉ッコの家の<ruby><rb>豆畑</rb><rp>（</rp><rt>まめばたけ</rt><rp>）</rp></ruby>でした。<br />\r\n　豆ばたけは、今はもう、茶色の豆の木でぎっしりです。<br />\r\n　豆はみな厚い茶色の<ruby><rb>外套</rb><rp>（</rp><rt>がいとう</rt><rp>）</rp></ruby>を着て、百列にも二百列にもなって、サッサッと歩いている兵隊のようです。<br />\r\n　お日さまはそらのうすぐもにはいり、向うの方のすすきの野原がうすく光っています。<br />\r\n　黒い鳥がその空の青じろいはてを、ななめにかけて行きました。<br />\r\n　お母さんたちがやっと林から出て来ました。それから向うの畑のへりを、もう二人の人が光ってこっちへやって参ります。一人は大きく一人は黒くて小さいのでした。<br />\r\n　それはたしかに、<ruby><rb>隣</rb><rp>（</rp><rt>とな</rt><rp>）</rp></ruby>りの<ruby><rb>善</rb><rp>（</rp><rt>ぜん</rt><rp>）</rp></ruby>コと、そのお母さんとにちがいありません。<br />\r\n「ホー、善コォ。」嘉ッコは高く叫びました。<br />\r\n「ホー。」高く返事が<ruby><rb>響</rb><rp>（</rp><rt>ひび</rt><rp>）</rp></ruby>いて来ます。そして二人はどっちからもかけ寄って、ちょうど畑の<ruby><rb>堺</rb><rp>（</rp><rt>さかい</rt><rp>）</rp></ruby>で会いました。善コの家の畑も、茶色外套の豆の木の兵隊で一杯です。<br />\r\n「<ruby><rb>汝</rb><rp>（</rp><rt>うな</rt><rp>）</rp></ruby>ぃの家さ、今朝、霜降ったが。」と嘉ッコがたずねました。<br />\r\n「霜ぁ、おれぁの家さ降った。うなぃの家さ降ったが。」善コがいいました。<br />\r\n「うん、降った。」<br />\r\n　それから二人は善コのお母さんが持って来た<ruby><rb>蓆</rb><rp>（</rp><rt>むしろ</rt><rp>）</rp></ruby>の上に<ruby><rb>座</rb><rp>（</rp><rt>すわ</rt><rp>）</rp></ruby>りました。お母さんたちはうしろで立って<ruby><rb>談</rb><rp>（</rp><rt>はな</rt><rp>）</rp></ruby>しています。<br />\r\n　二人はむしろに座って、<br />\r\n「わあああああああああ。」と云いながら両手で耳を<ruby><rb>塞</rb><rp>（</rp><rt>ふさ</rt><rp>）</rp></ruby>いだりあけたりして遊びました。ところが不思議なことは、「わああああ※<span class="notes">［＃小書き平仮名ん、148-10］</span>ああああ。」と云わないでも、両手で耳を塞いだりあけたりしますと、<br />\r\n「カーカーココーコー、ジャー。」という水の流れるような音が聞えるのでした。<br />\r\n「じゃ、<ruby><rb>汝</rb><rp>（</rp><rt>うな</rt><rp>）</rp></ruby>、あの音ぁ何の音だが<ruby><rb>覚</rb><rp>（</rp><rt>おべ</rt><rp>）</rp></ruby>だが。」<br />\r\n　と嘉ッコが云いました。善コもしばらくやって見ていましたが、やっぱりどうしてもそれがわからないらしく困ったように、<br />\r\n「<ruby><rb>奇体</rb><rp>（</rp><rt>きたい</rt><rp>）</rp></ruby>だな。」と云いました。<br />\r\n　その時丁度嘉ッコのお母さんが<ruby><rb>畦</rb><rp>（</rp><rt>あぜ</rt><rp>）</rp></ruby>の向うの方から豆を抜きながらだんだんこっちへ来ましたので、嘉ッコは高く叫びました。<br />\r\n「<ruby><rb>母</rb><rp>（</rp><rt>があ</rt><rp>）</rp></ruby>、こう<ruby><rb>云</rb><rp>（</rp><rt>ゆ</rt><rp>）</rp></ruby>にしてガアガアど聞えるものぁ何だべ。」<br />\r\n「<ruby><rb>西根山</rb><rp>（</rp><rt>にしねやま</rt><rp>）</rp></ruby>の<ruby><rb>滝</rb><rp>（</rp><rt>たき</rt><rp>）</rp></ruby>の音さ。」お母さんは豆の根の土をばたばた落しながら云いました。二人は西根山の方を見ました。けれどもそこから滝の音が聞えて来るとはどうも思われませんでした。<br />\r\n　お母さんが向うへ行って今度はおばあさんが来ました。<br />\r\n「ばさん。こう<ruby><rb>云</rb><rp>（</rp><rt>ゆ</rt><rp>）</rp></ruby>にしてガアガアコーコーど鳴るものぁ何だべ。」<br />\r\n　おばあさんはやれやれと<ruby><rb>腰</rb><rp>（</rp><rt>こし</rt><rp>）</rp></ruby>をのばして、手の<ruby><rb>甲</rb><rp>（</rp><rt>こう</rt><rp>）</rp></ruby>で額を<ruby><rb>一寸</rb><rp>（</rp><rt>ちょっと</rt><rp>）</rp></ruby>こすりながら、二人の方を見て云いました。<br />\r\n「<ruby><rb>天</rb><rp>（</rp><rt>あま</rt><rp>）</rp></ruby>の<ruby><rb>邪鬼</rb><rp>（</rp><rt>しゃぐ</rt><rp>）</rp></ruby>の<ruby><rb>小便</rb><rp>（</rp><rt>しょんべ</rt><rp>）</rp></ruby>の音さ。」<br />\r\n　二人は変な顔をしながら<ruby><rb>黙</rb><rp>（</rp><rt>だま</rt><rp>）</rp></ruby>ってしばらくその音を呼び寄せて聞いていましたが、<ruby><rb>俄</rb><rp>（</rp><rt>にわ</rt><rp>）</rp></ruby>かに善コがびっくりする位叫びました。<br />\r\n「ほう、天の邪鬼の小便ぁ永ぃな。」<br />\r\n　そこで嘉ッコが飛びあがって笑っておばあさんの所に走って行っていいました。<br />\r\n「アッハッハ、ばさん。天の邪鬼の小便ぁたまげだ永ぃな。」<br />\r\n「永ぃてさ、天の邪鬼ぁいっつも小便、垂れ通しさ。」とおばあさんはすまして云いながら<ruby><rb>又</rb><rp>（</rp><rt>また</rt><rp>）</rp></ruby>豆を抜きました。嘉ッコは<ruby><rb>呆</rb><rp>（</rp><rt>あき</rt><rp>）</rp></ruby>れてぼんやりとむしろに座りました。<br />\r\n　お日さまはうすい白雲にはいり、黒い鳥が高く高く<ruby><rb>環</rb><rp>（</rp><rt>わ</rt><rp>）</rp></ruby>をつくっています。その雲のこっち、豆の畑の向うを、<ruby><rb>鼠色</rb><rp>（</rp><rt>ねずみいろ</rt><rp>）</rp></ruby>の服を着て、鳥打をかぶったせいのむやみに高い男が、なにかたくさん肩にかついで<ruby><rb>大股</rb><rp>（</rp><rt>おおまた</rt><rp>）</rp></ruby>に歩いて行きます。<br />\r\n「兵隊さん。」善コが叫びながらそっちへかけ出しました。<br />\r\n「兵隊さ※<span class="notes">［＃小書き平仮名ん、150-3］</span>だなぃ。<ruby><rb>鉄砲</rb><rp>（</rp><rt>てっぽう</rt><rp>）</rp></ruby>持ってなぃぞ。」嘉ッコも走りながら云いました。<br />\r\n「兵隊さん。」善コが又叫びました。<br />\r\n「兵隊さんだなぃ。鉄砲持ってなぃぞ。」けれどもその時は二人はもう旅人の三間ばかりこっちまで来ていました。<br />\r\n「兵隊さん。」善コは又叫んでからおかしな顔をしてしまいました。見るとその人は赤ひげで西洋人なのです。おまけにその男が口を大きくして叫びました。<br />\r\n「グルルル、グルウ、ユー、リトル、ラズカルズ、ユー、プレイ、トラウント、ビ、オッフ、ナウ、スカッド、アウエイ、テゥ、スクール。」<br />\r\n　と<ruby><rb>雷</rb><rp>（</rp><rt>かみなり</rt><rp>）</rp></ruby>のような声でどなりました。そこで二人はもうグーとも云わず、まん円になって一目散に<ruby><rb>逃</rb><rp>（</rp><rt>に</rt><rp>）</rp></ruby>げました。するとうしろではいかにも<ruby><rb>面白</rb><rp>（</rp><rt>おもしろ</rt><rp>）</rp></ruby>そうに高く笑う声がします。向うの方ではお母さんたちが心配そうに手をかざしてこっちを見ていましたが、やがて一寸おじぎをしました。二人は<ruby><rb>振</rb><rp>（</rp><rt>ふ</rt><rp>）</rp></ruby>り返って見ますとその鼠色の旅人も笑いながら<ruby><rb>帽子</rb><rp>（</rp><rt>ぼうし</rt><rp>）</rp></ruby>をとっておじぎをして<ruby><rb>居</rb><rp>（</rp><rt>お</rt><rp>）</rp></ruby>りました。そして又大股に向うに歩いて行ってしまいました。<br />\r\n　お日さまが又かっと明るくなり、二人はむしろに座ってひばりもいないのに、<br />\r\n「ひばり焼げこ、ひばりこんぶりこ、」なんて<ruby><rb>出鱈目</rb><rp>（</rp><rt>でたらめ</rt><rp>）</rp></ruby>なひばりの歌を歌っていました。<br />\r\n　そのうちに嘉ッコがふと思い出したように歌をやめて、一寸顔をしかめましたが、俄かに云いました。<br />\r\n「じゃ、うなぃの<ruby><rb>爺</rb><rp>（</rp><rt>じ</rt><rp>）</rp></ruby>※<span class="notes">［＃小書き平仮名ん、151-2］</span>ごぁ、酔ったぐれだが。」<br />\r\n「うんにゃ、おれぁの爺※<span class="notes">［＃小書き平仮名ん、151-3］</span>ごぁ酔ったぐれだなぃ。」善コが答えました。<br />\r\n「そだら、うなぃの爺※<span class="notes">［＃小書き平仮名ん、151-4］</span>ごど俺ぁの爺※<span class="notes">［＃小書き平仮名ん、151-4］</span>ごど、爺※<span class="notes">［＃小書き平仮名ん、151-4］</span>ご取っ<ruby><rb>換</rb><rp>（</rp><rt>か</rt><rp>）</rp></ruby>ぇだらいがべじゃぃ。取っ換ぇなぃどが。」嘉ッコがこれを云うか云わないにウンと云うくらいひどく耳をひっぱられました。見ると嘉ッコのおじいさんがけらを着て<ruby><rb>章魚</rb><rp>（</rp><rt>たこ</rt><rp>）</rp></ruby>のような赤い顔をして嘉ッコを上から見おろしているのでした。<br />\r\n「なにしたど。爺※<span class="notes">［＃小書き平仮名ん、151-8］</span>ご取っ換ぇるど。それよりもうなのごと山山のへっぴり<ruby><rb>伯父</rb><rp>（</rp><rt>おじ</rt><rp>）</rp></ruby>さ<ruby><rb>呉</rb><rp>（</rp><rt>け</rt><rp>）</rp></ruby>でやるべが。」<br />\r\n「じさん、許せゆるせ、取っ換ぇなぃはんて、ゆるせ。」嘉ッコは泣きそうになってあやまりました。そこでじいさんは笑って自分も豆を抜きはじめました。<br />\r\n<br />\r\n　　　　　　　　＊<br />\r\n<br />\r\n　火は赤く燃えています。けむりは主におじいさんの方へ行きます。<br />\r\n　嘉ッコは、<ruby><rb>黒猫</rb><rp>（</rp><rt>くろねこ</rt><rp>）</rp></ruby>をしっぽでつかまえて、ギッと云うくらいに<ruby><rb>抱</rb><rp>（</rp><rt>だ</rt><rp>）</rp></ruby>いていました。向う側ではもう学校に行っている嘉ッコの兄さんが、<ruby><rb>鞄</rb><rp>（</rp><rt>かばん</rt><rp>）</rp></ruby>から<ruby><rb>読本</rb><rp>（</rp><rt>とくほん</rt><rp>）</rp></ruby>を出して声を立てて読んでいました。<br />\r\n<div class="jisage_2" style="margin-left: 2em">\r\n「松を火にたくいろりのそばで<br />\r\n　よるはよもやまはなしがはずむ<br />\r\n　母が手ぎわのだいこんなます<br />\r\n　これがいなかのとしこしざかな。第十三課……。」<br />\r\n</div>\r\n「何したど。大根なますだど。としこしざがなだど。あんまりけづな書物だな。」とおじいさんがいきなり云いました。そこで嘉ッコのお父さんも笑いました。<br />\r\n「なあにこの書物ぁ<ruby><rb>倹約</rb><rp>（</rp><rt>けんやく</rt><rp>）</rp></ruby>教えだのだべも。」<br />\r\n　ところが嘉ッコの兄さんは、すっかり怒ってしまいました。そしてまるで泣き出しそうになって、読本を鞄にしまって、<br />\r\n「嘉ッコ、猫ぉおれさ<ruby><rb>寄越</rb><rp>（</rp><rt>よこ</rt><rp>）</rp></ruby>せじゃ。」と云いました。<br />\r\n「わがなぃんちゃ。<ruby><rb>厭</rb><rp>（</rp><rt>や</rt><rp>）</rp></ruby>んた※<span class="notes">［＃小書き平仮名ん、152-9］</span>ちゃ。」と嘉ッコが云いました。<br />\r\n「寄越せったら、寄越せ。嘉ッコぉ。わあい。寄越せじゃぁ。」<br />\r\n「<ruby><rb>厭</rb><rp>（</rp><rt>や</rt><rp>）</rp></ruby>※<span class="notes">［＃小書き平仮名ん、152-11］</span>たぁ、厭※<span class="notes">［＃小書き平仮名ん、152-11］</span>たぁ、厭※<span class="notes">［＃小書き平仮名ん、152-11］</span>たったら。」<br />\r\n「そだら<ruby><rb>撲</rb><rp>（</rp><rt>は</rt><rp>）</rp></ruby>だぐじゃぃ。いいが。」嘉ッコの兄さんが向うで立ちあがりました。おじいさんがそれをとめ、嘉ッコがすばやく逃げかかったとき、<ruby><rb>俄</rb><rp>（</rp><rt>にわか</rt><rp>）</rp></ruby>に<ruby><rb>途方</rb><rp>（</rp><rt>とほう</rt><rp>）</rp></ruby>もない、空の青セメントが一ぺんに落ちたというようなガタアッという音がして家はぐらぐらっとゆれ、みんなはぼかっとして呆れてしまいました。猫は嘉ッコの手から<ruby><rb>滑</rb><rp>（</rp><rt>すべ</rt><rp>）</rp></ruby>り落ちて、ぶるるっとからだをふるわせて、それから一目散にどこかへ走って行ってしまいました。「ガリガリッ、ゴロゴロゴロゴロ。」音は続き、それからバァッと表の方が鳴って何か石ころのようなものが一散に降って来たようすです。<br />\r\n「お<ruby><rb>雷</rb><rp>（</rp><rt>らい</rt><rp>）</rp></ruby>さんだ。」おじいさんが云いました。<br />\r\n「<ruby><rb>雹</rb><rp>（</rp><rt>ひょう</rt><rp>）</rp></ruby>だ。」お父さんが云いました。ガアガアッというその雹の音の向うから、<br />\r\n「ホーォ。」ととなりの善コの声が聞えます。<br />\r\n「ホーォ。」と嘉ッコが答えました。<br />\r\n「ホーォォ。」となりで又叫んでいます。<br />\r\n「ホーォォー。」嘉ッコが<ruby><rb>咽喉</rb><rp>（</rp><rt>のど</rt><rp>）</rp></ruby>一杯<ruby><rb>笛</rb><rp>（</rp><rt>ふえ</rt><rp>）</rp></ruby>のようにして叫びました。<br />\r\n　俄に外の音はやみ、<ruby><rb>淵</rb><rp>（</rp><rt>ふち</rt><rp>）</rp></ruby>の底のようにしずかになってしまって気味が悪いくらいです。<br />\r\n　嘉ッコの兄さんは雹を取ろうと<ruby><rb>下駄</rb><rp>（</rp><rt>げた</rt><rp>）</rp></ruby>をはいて表に出ました。嘉ッコも続いて出ました。空はまるで新らしく<ruby><rb>拭</rb><rp>（</rp><rt>ふ</rt><rp>）</rp></ruby>いた鏡のようになめらかで、青い七日ごろのお月さまがそのまん中にかかり、地面はぎらぎら光って嘉ッコは<ruby><rb>一寸</rb><rp>（</rp><rt>ちょっと</rt><rp>）</rp></ruby>氷砂糖をふりまいたのだとさえ思いました。<br />\r\n　南のずうっと向うの方は、白い雲か<ruby><rb>霧</rb><rp>（</rp><rt>きり</rt><rp>）</rp></ruby>かがかかり、<ruby><rb>稲光</rb><rp>（</rp><rt>いなびか</rt><rp>）</rp></ruby>りが月あかりの中をたびたび白く<ruby><rb>渡</rb><rp>（</rp><rt>わた</rt><rp>）</rp></ruby>ります。二人は<ruby><rb>雀</rb><rp>（</rp><rt>すずめ</rt><rp>）</rp></ruby>の卵ぐらいある雹の<ruby><rb>粒</rb><rp>（</rp><rt>つぶ</rt><rp>）</rp></ruby>をひろって<ruby><rb>愕</rb><rp>（</rp><rt>おど</rt><rp>）</rp></ruby>ろきました。<br />\r\n「ホーォ。」善コの声がします。<br />\r\n「ホーォ。」嘉ッコと嘉ッコの兄さんとは一所に叫びながら<ruby><rb>垣根</rb><rp>（</rp><rt>かきね</rt><rp>）</rp></ruby>の柳の木の下まで出て行きました。となりの垣根からも小さな黒い<ruby><rb>影</rb><rp>（</rp><rt>かげ</rt><rp>）</rp></ruby>がプイッと出てこっちへやって参ります。善コです。嘉ッコは走りました。<br />\r\n「ほお、雹だじゃぃ。大きじゃぃ。こったに大きじゃぃ。」<br />\r\n　善コも一杯つかんでいました。<br />\r\n「<ruby><rb>俺家</rb><rp>（</rp><rt>おらい</rt><rp>）</rp></ruby>のなもこの位あるじゃぃ。」<br />\r\n　稲ずまが又白く光って通り過ぎました。<br />\r\n「あ、山山のへっぴり伯父。」嘉ッコがいきなり西を指さしました。西根の山山のへっぴり伯父は月光に青く光って長々とからだを横たえました。', '<ruby><rb>嘉</rb><rp>（</rp><rt>か</rt><rp>）</rp></ruby>ッコは、小さなわらじをはいて、赤いげんこを二つ顔の前にそろえて、ふっふっと息をふきかけながら、土間から外へ飛び出しました。外はつめたくて明るくて、そしてしんとしています。', '2015-09-23', '2015-09-23', '2015-09-27', 0, '宮沢賢治', 0, '', '', 0, 0);

